  `username` char(30) DEFAULT NULL,
  `email` varchar(50) DEFAULT NULL,
  `password` char(32) DEFAULT NULL,
  `password_2` char(32) DEFAULT NULL,
  `password_3` char(32) DEFAULT NULL,
  `head_photo` varchar(50) DEFAULT NULL,
  `real_name_auth` tinyint(1) DEFAULT '0' COMMENT '是否已经实名认证 0 未认证 1 已认证 2 审核中',
  `real_name` varchar(10) DEFAULT NULL COMMENT '真实姓名',
