  `card_img_1` varchar(50) DEFAULT NULL COMMENT '身份证图片',
  `card_img_2` varchar(50) DEFAULT NULL,
  `residence` varchar(50) DEFAULT NULL COMMENT '户籍所在地',
  `bank_name` varchar(50) DEFAULT NULL COMMENT '银行名称',
  `bank_address` varchar(50) DEFAULT NULL COMMENT '银行地址',
  `bank_num` varchar(50) DEFAULT NULL COMMENT '银行账号',
  `alipay_id` varchar(50) DEFAULT NULL COMMENT '支付宝账号',
  `wechat_id` varchar(50) DEFAULT NULL COMMENT '微信账号',
  `salt` char(6) DEFAULT NULL,
  `mobile` char(11) DEFAULT NULL COMMENT '电话',
  `register_time` char(10) DEFAULT NULL COMMENT '注册时间',
  `user_status` tinyint(1) DEFAULT '1' COMMENT '用户状态 1 正常 2 静态',
  `token` char(32) DEFAULT NULL,
  `rank` tinyint(1) DEFAULT '1' COMMENT '用户等级 0 未激活 1 消费商 2 合格的消费商 3 合作商 4特殊的合作商',
  `star_level` tinyint(1) DEFAULT '0' COMMENT '合作商星级',
  `agent_level` tinyint(1) DEFAULT '0' COMMENT '0：不是代理 1：县级代理，2：市级代理，3：省级代理',
  `agent_province` int(10) DEFAULT '0' COMMENT '代理省id',
  `agent_city` int(10) DEFAULT '0' COMMENT '代理市id',
  `agent_district` int(10) DEFAULT '0' COMMENT '代理区id',
  `store_id` int(10) DEFAULT NULL COMMENT '店铺id',
  `referrer_id` int(10) DEFAULT '0' COMMENT '推荐人id',
  `referrer_node_id` int(10) DEFAULT NULL COMMENT '推荐人节点号',
  `position` char(5) DEFAULT NULL COMMENT '自动下滑到双轨网络中的位置',
  `upgrade_times` int(1) DEFAULT '0' COMMENT '升级次数',
  PRIMARY KEY (`uid`)
) ENGINE=InnoDB AUTO_INCREMENT=128 DEFAULT CHARSET=utf8 COMMENT='会员表';

