CREATE TABLE `ms_mall_pond` (
  `code` char(10) DEFAULT NULL,
  `total` bigint(20) DEFAULT '0'
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='黑金总数';

