CREATE TABLE `ms_mall_shipping_area` (
  `templ_id` int(4) DEFAULT NULL COMMENT '模板id',
  `area_id` int(4) DEFAULT NULL COMMENT '区域id',
  `shipping_id` int(4) DEFAULT NULL COMMENT '配送方式id'
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='配送区域';

