-- Table structure for ms_mall_shipping_template
-- ----------------------------
DROP TABLE IF EXISTS `ms_mall_shipping_template`;
CREATE TABLE `ms_mall_shipping_template` (
  `templ_id` smallint(5) unsigned NOT NULL AUTO_INCREMENT,
  `templ_name` varchar(150) NOT NULL DEFAULT '',
  `type` int(1) DEFAULT '1' COMMENT '1按重量计费2按数量计费',
  `first_fee` decimal(10,2) DEFAULT '0.00' COMMENT '首重/首件',
  `next_fee` decimal(10,2) DEFAULT '0.00' COMMENT '续重/续件',
  `store_id` int(10) DEFAULT '0' COMMENT '店铺id',
  `shipping_id_str` text,
  `province_str` text,
