-- ----------------------------
-- Table structure for ms_mall_store
-- ----------------------------
DROP TABLE IF EXISTS `ms_mall_store`;
CREATE TABLE `ms_mall_store` (
  `store_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '店铺索引id',
  `uid` int(11) NOT NULL COMMENT '会员id',
  `username` varchar(50) NOT NULL COMMENT '会员名称',
  `store_name` varchar(50) NOT NULL COMMENT '店铺名称',
  `store_auth` tinyint(1) DEFAULT '0' COMMENT '店铺认证',
  `name_auth` tinyint(1) DEFAULT '0' COMMENT '店主认证',
  `grade_id` int(11) NOT NULL COMMENT '店铺等级',
  `store_owner_card` varchar(50) NOT NULL COMMENT '身份证',
  `sc_id` int(11) NOT NULL COMMENT '店铺分类',
  `company_name` varchar(50) DEFAULT NULL COMMENT '店铺公司名称',
  `area_id` int(11) NOT NULL COMMENT '地区id',
  `store_address` varchar(100) NOT NULL COMMENT '详细地区',
  `store_zip` varchar(10) NOT NULL COMMENT '邮政编码',
  `store_tel` varchar(50) NOT NULL COMMENT '电话号码',
  `store_image` varchar(100) DEFAULT NULL COMMENT '证件上传',
  `store_image1` varchar(100) DEFAULT NULL COMMENT '执照上传',
  `store_status` tinyint(1) NOT NULL DEFAULT '2' COMMENT '店铺状态，0关闭，1开启，2审核中',
  `store_close_info` varchar(255) DEFAULT NULL COMMENT '店铺关闭原因',
  `store_sort` int(11) NOT NULL DEFAULT '0' COMMENT '店铺排序',
  `store_start_time` varchar(10) NOT NULL COMMENT '店铺开始时间',
  `store_end_time` varchar(10) DEFAULT NULL COMMENT '店铺关闭时间',
  `store_logo` varchar(255) DEFAULT NULL COMMENT '店铺logo',
  `store_banner` varchar(255) DEFAULT NULL COMMENT '店铺横幅',
  `store_keywords` varchar(255) NOT NULL DEFAULT '' COMMENT '店铺seo关键字',
  `store_description` varchar(255) NOT NULL DEFAULT '' COMMENT '店铺seo描述',
  `store_qq` varchar(50) DEFAULT NULL COMMENT 'QQ',
  `store_ww` varchar(50) DEFAULT NULL COMMENT '阿里旺旺',
  `description` text COMMENT '店铺简介',
  `store_zy` text COMMENT '主营商品',
  `store_domain` varchar(50) DEFAULT NULL COMMENT '店铺二级域名',
  `store_domain_times` tinyint(1) unsigned DEFAULT '0' COMMENT '二级域名修改次数',
  `store_recommend` tinyint(1) NOT NULL DEFAULT '0' COMMENT '推荐，0为否，1为是，默认为0',
  `store_theme` varchar(50) NOT NULL DEFAULT 'default' COMMENT '店铺当前主题',
  `store_credit` int(10) NOT NULL DEFAULT '0' COMMENT '店铺信用',
  `praise_rate` float NOT NULL DEFAULT '0' COMMENT '店铺好评率',
  `store_desccredit` float NOT NULL DEFAULT '0' COMMENT '描述相符度分数',
  `store_servicecredit` float NOT NULL DEFAULT '0' COMMENT '服务态度分数',
  `store_deliverycredit` float NOT NULL DEFAULT '0' COMMENT '发货速度分数',
  `collect_times` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '店铺收藏次数',
  `store_slide` text COMMENT '店铺幻灯片',
  `store_slide_url` text COMMENT '店铺幻灯片链接',
  `store_stamp` varchar(200) DEFAULT NULL COMMENT '店铺印章',
  `store_printdesc` varchar(500) DEFAULT NULL COMMENT '打印订单页面下方说明文字',
  `store_sales` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '店铺销量',
  `store_presales` text COMMENT '售前客服',
  `store_aftersales` text COMMENT '售后客服',
  `store_workingtime` varchar(100) DEFAULT NULL COMMENT '工作时间',
  `store_free_price` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '超出该金额免运费，大于0才表示该值有效',
  `store_storage_alarm` tinyint(3) unsigned NOT NULL DEFAULT '10' COMMENT '库存警报',
  `company_location` varchar(200) DEFAULT NULL COMMENT '公司所在地',
  `company_province` varchar(10) DEFAULT NULL COMMENT '省id',
  `company_city` varchar(10) DEFAULT NULL COMMENT '市id',
  `company_district` varchar(10) DEFAULT NULL COMMENT '区/县id',
  `company_address` varchar(200) DEFAULT NULL COMMENT '公司详细地址',
  `company_phone` varchar(20) DEFAULT NULL COMMENT '公司电话',
  `employees_count` int(4) DEFAULT '1' COMMENT '员工人数',
  `registered_capital` int(4) DEFAULT '1' COMMENT '注册资金',
  `contacts_name` varchar(50) DEFAULT NULL,
  `contacts_phone` varchar(20) DEFAULT NULL,
  `contacts_email` varchar(200) DEFAULT NULL,
  `business_licence_number` varchar(30) DEFAULT NULL,
  `business_licence_pic` varchar(50) DEFAULT NULL,
  `business_scope` text,
  `company_description` text,
  `join_time` varchar(50) DEFAULT NULL COMMENT '入驻时间',
  `bank_account_name` varchar(30) DEFAULT NULL COMMENT '银行开户名',
  `bank_account_number` varchar(30) DEFAULT NULL COMMENT '开户账号',
  `bank_name` varchar(30) DEFAULT NULL COMMENT '开户行名称',
  `proportion` float(5,2) DEFAULT '0.00' COMMENT '平台占比',
  `offline_address` varchar(50) DEFAULT NULL,
  `lat` varchar(50) DEFAULT NULL COMMENT '维度',
  `lng` varchar(50) DEFAULT NULL COMMENT '经度',
  `lbs_id` int(10) DEFAULT NULL COMMENT '百度lbs唯一标识',
  PRIMARY KEY (`store_id`),
  KEY `store_name` (`store_name`),
  KEY `sc_id` (`sc_id`),
  KEY `area_id` (`area_id`),
  KEY `store_state` (`store_status`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8 COMMENT='店铺数据表';

-- ----------------------------
-- Records of ms_mall_store
-- ----------------------------

-- ----------------------------
-- Table structure for ms_mall_store_goods_class
-- ----------------------------
DROP TABLE IF EXISTS `ms_mall_store_goods_class`;
CREATE TABLE `ms_mall_store_goods_class` (
  `sc_id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '索引ID',
  `sc_name` varchar(100) NOT NULL COMMENT '分类名称',
  `sc_parent_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '父ID',
  `sc_sort` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '排序',
  `sc_keywords` varchar(255) NOT NULL DEFAULT '' COMMENT '关键词',
  `sc_description` varchar(255) NOT NULL DEFAULT '' COMMENT '描述',
  `store_id` int(10) DEFAULT '0' COMMENT '店铺id',
  PRIMARY KEY (`sc_id`),
  KEY `store_id` (`sc_parent_id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8 COMMENT='商品分类表';

-- ----------------------------
-- Records of ms_mall_store_goods_class
-- ----------------------------

-- ----------------------------
-- Table structure for ms_mall_store_navigation
-- ----------------------------
DROP TABLE IF EXISTS `ms_mall_store_navigation`;
CREATE TABLE `ms_mall_store_navigation` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `nav_name` varchar(250) NOT NULL DEFAULT '' COMMENT '栏目名称',
  `nav_sort` int(10) unsigned NOT NULL COMMENT '排序',
  `nav_url` varchar(250) NOT NULL DEFAULT '' COMMENT '外链地址',
  `nav_keywords` varchar(250) NOT NULL DEFAULT '' COMMENT '栏目关键字',
  `nav_description` varchar(250) NOT NULL DEFAULT '' COMMENT '栏目描述',
  `is_show` smallint(1) DEFAULT '1' COMMENT '是否显示',
  `store_id` int(10) DEFAULT '0' COMMENT '店铺id',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=17 DEFAULT CHARSET=utf8 COMMENT='店铺导航菜单';

-- ----------------------------
-- Records of ms_mall_store_navigation
-- ----------------------------

-- ----------------------------
-- Table structure for ms_mall_store_slide
-- ----------------------------
DROP TABLE IF EXISTS `ms_mall_store_slide`;
CREATE TABLE `ms_mall_store_slide` (
  `slide_id` int(4) NOT NULL AUTO_INCREMENT,
  `img` varchar(100) DEFAULT NULL,
  `url` varchar(100) DEFAULT NULL,
  `alt` varchar(100) DEFAULT NULL,
  `sort` int(4) DEFAULT NULL,
  `enabled` int(1) DEFAULT '1',
  `store_id` int(11) DEFAULT NULL COMMENT '店铺id',
  `goods_id` text COMMENT '产品id，多个',
  PRIMARY KEY (`slide_id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COMMENT='店铺幻灯';

-- ----------------------------
-- Records of ms_mall_store_slide
-- ----------------------------
